[[package]]
name = "aiolimiter"
version = "1.0.0"
requires_python = ">=3.6.1,<4.0.0"
summary = "asyncio rate limiter, a leaky bucket implementation"

[[package]]
name = "anyio"
version = "3.6.2"
requires_python = ">=3.6.2"
summary = "High level compatibility layer for multiple asynchronous event loop implementations"
dependencies = [
    "idna>=2.8",
    "sniffio>=1.1",
]

[[package]]
name = "certifi"
version = "2022.12.7"
requires_python = ">=3.6"
summary = "Python package for providing Mozilla's CA Bundle."

[[package]]
name = "h11"
version = "0.14.0"
requires_python = ">=3.7"
summary = "A pure-Python, bring-your-own-I/O implementation of HTTP/1.1"

[[package]]
name = "httpcore"
version = "0.16.3"
requires_python = ">=3.7"
summary = "A minimal low-level HTTP client."
dependencies = [
    "anyio<5.0,>=3.0",
    "certifi",
    "h11<0.15,>=0.13",
    "sniffio==1.*",
]

[[package]]
name = "httpx"
version = "0.23.1"
requires_python = ">=3.7"
summary = "The next generation HTTP client."
dependencies = [
    "certifi",
    "httpcore<0.17.0,>=0.15.0",
    "rfc3986[idna2008]<2,>=1.3",
    "sniffio",
]

[[package]]
name = "idna"
version = "3.4"
requires_python = ">=3.5"
summary = "Internationalized Domain Names in Applications (IDNA)"

[[package]]
name = "python-telegram-bot"
version = "20.0b0"
requires_python = ">=3.7"
summary = "We have made you a wrapper you can't refuse"
dependencies = [
    "httpx~=0.23.1",
]

[[package]]
name = "python-telegram-bot"
version = "20.0b0"
extras = ["rate-limiter"]
requires_python = ">=3.7"
summary = "We have made you a wrapper you can't refuse"
dependencies = [
    "aiolimiter~=1.0.0",
    "python-telegram-bot==20.0b0",
]

[[package]]
name = "rfc3986"
version = "1.5.0"
summary = "Validating URI References per RFC 3986"

[[package]]
name = "rfc3986"
version = "1.5.0"
extras = ["idna2008"]
summary = "Validating URI References per RFC 3986"
dependencies = [
    "idna",
    "rfc3986==1.5.0",
]

[[package]]
name = "sniffio"
version = "1.3.0"
requires_python = ">=3.7"
summary = "Sniff out which async library your code is running under"

